></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">更换锚固：局部注浆止水</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">局部增设预应力锚固</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">偶发荷载影响</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">局部补强：局部注浆止水</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">局部表面喷护</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">锚杆</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, 