uot;;\">局部补强：局部注浆止水</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">高风险区增设预应力锚固</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">长期荷载条件变化</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">系统补强：局部注浆止水</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">高风险区表面喷护</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">挂网</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">预应力锚固</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr></tbody></table></div><p class=\"MsoNormal\" style=\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\"><span lang=\"EN-US\">&nbsp;</span></p><h4 style=\"font-family: &quot;等线 Light&quot;; line-height: 18.8pt; color: rgb(0, 0, 0); margin: 6pt 0cm 0cm 22.6pt; font-size: 14pt; text-align: justify; text-indent: -5.65pt; break-after: avoid;\"><span lang=\"EN-US\">（3）<span style=\"font-variant-n