INSERT INTO `news_content` (`news_content_id`, `news_content_title`, `news_content_text`, `news_menu_id`) VALUES (13, 'AOP', '                                                                                                                                                                                                <h2>AOP<br></h2><h2>若依后台管理系统</h2>\r\n                                <p>ruoyi是一个完全响应式，基于Bootstrap3.3.6最新版本开发的扁平化主题，她采用了主流的左右两栏式布局，使用了Html5+CSS3等现代技术，她提供了诸多的强大的可以重新组合的UI组件，并集成了最新的jQuery版本(v2.1.1)，当然，也集成了很多功能强大，用途广泛的就jQuery插件，她可以用于所有的Web应用程序，如<b>网站管理后台</b>，<b>网站会员中心</b>，<b>CMS</b>，<b>CRM</b>，<b>OA</b>等等，当然，您也可以对她进行深度定制，以做出更强系统。</p>\r\n                                <p>\r\n                                    <b>当前版本：</b>v4.1.0\r\n                                </p>\r\n                                <p>\r\n                                    <span class=\"label label-warning\">免费开源a</span></p>\r\n                            \r\n                            \r\n                            \r\n                            \r\n                            \r\n                            ', 14);
INSERT INTO `news_content` (`news_content_id`, `news_content_title`, `news_content_text`, `news_menu_id`) VALUES (14, 'xccx', '                                <h2>若依后台管理系统</h2>\r\n                                <p>ruoyi是一个完全响应式，基于Bootstrap3.3.6最新版本开发的扁平化主题，她采用了主流的左右两栏式布局，使用了Html5+CSS3等现代技术，她提供了诸多的强大的可以重新组合的UI组件，并集成了最新的jQuery版本(v2.1.1)，当然，也集成了很多功能强大，用途广泛的就jQuery插件，她可以用于所有的Web应用程序，如<b>网站管理后台</b>，<b>网站会员中心</b>，<b>CMS</b>，<b>CRM</b>，<b>OA</b>等等，当然，您也可以对她进行深度定制，以做出更强系统。</p>\r\n                                <p>\r\n                                    <b>当前版本：</b>v4.1.0\r\n                                </p>\r\n                                <p>\r\n                                    <span class=\"label label-warning\">免费开源</span>\r\n                                </p>\r\n                            ', 15);
