al\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">轻度变形破坏表现：个别部位衬砌表面裂缝、起壳、渗水等，应根据变形破坏原因进行分析并采用针对性抢修抢建方案。具体原因分为以下几种：（</span><span lang=\\\"EN-US\\\">1</span><span style=\\\"font-family: 宋体;\\\">）系统支护强度不足；（</span><span lang=\\\"EN-US\\\">2</span><span style=\\\"font-family: 宋体;\\\">）系统支护老化；（</span><span lang=\\\"EN-US\\\">3</span><span s', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:16:17');
