\\">”</span><span style=\\\"font-family: 宋体;\\\">五级排序匹配加固技术方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" align=\\\"center\\\" style=\\\"margin: 0cm; text-align: center; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">表</span><span lang=\\\"EN-US\\\">2.12 </span><span style=\\\"font-family: 宋体;\\\">加固响应选择对照表</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><tabl', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:21:19');
INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (214, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"被覆结构变形抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏表现：被覆结构变形过大、局部稳定性破坏、失稳破坏；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏原因：极端荷载、地应力、材料性能失效等；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">加固方案：被覆结构变形破坏可采用嵌拱及钢带加固和套拱加固，局部失稳和整体失稳破坏采用围岩变形破坏的抢修抢建工程加固技术方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">（</span><span lang=\\\"EN-US\\\">a</span><span style=\\\"font-family: 仿宋;\\\">）嵌拱及钢带加固，被覆结构衬砌裂缝较严重、但结构尚有较强承载能力时，可通过嵌拱（轨）、钢带以及网片加喷射（钢纤维）混凝土的方法对结构进行加固。嵌拱（轨）法和钢带加固法通过在衬砌结构内环向支撑（或凿槽埋设）钢带、钢拱架或钢轨，从而使衬砌结构得到有效的支撑。嵌拱（轨）加固可根据实际需要直接在衬砌外施作，也可以在原衬砌内凿槽安装，具体施作方式可根据紧急程度、加固目的、建筑限界因素综合选定。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">（</span><span lang=\\\"EN-US\\\" style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif;\\\">b</span><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">）套拱加固技术，被覆结构净空允许且衬砌结构存在一定的承载能力时，在既有衬砌外重新施作套拱结构，新施作结构与原结构形成一体共同承担围岩压力，在充分利用原有结构承载力基础上，保证结构安全。套拱可通过模筑混凝土施工，也可用喷射（钢纤维、碳纤维）混凝土方式施作，喷射混凝土添加钢纤维和碳纤维可有效增强结构承载能力，减少套拱结构厚度。</span><span style=\\\"color: rgb(0, 0, 0); font-', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:23:47');
INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (215, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"被覆结构劣化抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏表现：支护结构的强度降低、混凝土碳化、钢筋锈蚀、钢筋脆化、疲劳、应力损失、钢筋与混凝土之间粘结锚固作用削弱；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏原因：极端荷载、材料性能失效等；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">加固方案：在原有结构已失去承载能力或结构净空不允许时，可采用钢带、嵌拱等方法提供其支护能力。更为严重的情况时候，需将原有衬砌结构拆除并更换。与衬砌套拱类似，衬砌更换可分为整体全换和局部结构更换。新材料、新技术和新工艺，如喷射碳（钢）纤维混凝土加网片、粘碳（芳纶）纤维板（布）法、粘钢板法等方法也可用于加固处理。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:24:23');
INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (216, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"被覆结构裂缝、渗漏水和表层破坏抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">加固方案：根据裂缝产生的原因选择加固方法：如针对非结构性裂缝，不影响整体的力学性能，可采取提高构建观感质量和耐久性修补；对于结构性裂缝，由于其不断发展会危及结构安全，要采取加固方法。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">非结构性裂缝可采用封堵和表面处理的方法，裂缝宽度在</span><span lang=\\\"EN-US\\\">0.2~1mm</span><span style=\\\"font-family: 仿宋;\\\">时，需用高强度密封砂浆将裂缝表面封闭，以防止裂缝内钢筋氧化，同时起缝合作用，并防止裂缝进一步发展；裂缝宽度大于１ｍｍ时，用注射等方法将环氧树脂和高强度胶填充裂缝，且采用表面封堵法，即在开裂的混凝土表面涂刷水泥浆、油漆、沥青、环氧树脂等液体材料，多层涂刷，利用液体的毛细吸力堵塞裂缝，减少渗漏、防止钢筋锈蚀。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">结构性裂缝加固方法有：加大截面法、外包钢筋加固法、预应力加固法、增加支点加固法、粘钢或碳纤维加固法及多种方法的联合使用。在使用过程中在综合结构特征、裂缝严重程度、施工适用性、施工周期等因素确定。加固后的整体效果取决于新老混凝土结合面能否有效结合，加固过程中药提高二者的结合性能。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:25:29');
INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (217, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"热环境破坏抢修抢建技术\"],\"content\":[\"<h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1） </span><span style=\\\"font-family: 仿宋;\\\">温度过高或者过低</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加或者减少通风系统的通风量，或者调整送风温度，从而满足温度要求。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">2） </span><span style=\\\"font-family: 仿宋;\\\">相对湿度过高</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加通风系统的通风量，或者增加独立除湿设备。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:28:29');
INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`) VALUES (218, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"风环境破坏抢修抢建技术\"],\"content\":[\"<h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1） </span><span style=\\\"font-family: 仿宋;\\\">风速过高或者过低</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加或者减少通风系统的通风量。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">2） </span><span style=\\\"font-family: 仿宋;\\\">气压过大</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">减少通风系统的通风量，或者增加排风量。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">3） </span><span style=\\\"font-family: 仿宋;\\\">气压过小</span><spa