N-US\\\">3</span></b><b><span style=\\\"font-family: 仿宋;\\\">）风管裂缝</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">用胶带处理。先用防水胶带（又称防水纸）在裂缝的风管外面包好几层，然后用泡沫胶包好，再包在外面，再包在泡沫胶外面的防水纸上，再包在防水纸外面的泡沫纸上。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" styl', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:45:38');
